text:
@globaltimesnews It would be prudent to address the Foxconn incident. Fake news and disinformation is rampant. 

Regular updates on Dynamic Covid measures and progress would also be critical for folks who do business in and invest in China.

Chinese media must counter these disinformation.

@EGCollective @Eric_Schmitt Yes, I'm sure you know why the people I worked with quit their jobs. It has everything to do with Covid. And the people who spit in our faces denying its existence even when we desperately tried to keep them alive. 
 The family members threatening violence were fun too. 
Stop.
